import React from 'react';
import {withRouter} from 'react-router';

function AppointmentList(props){
  const {appointments} = props
  return(
    <div className="Appointment">
    <p> You have {appointments.length} appointment comming up </p>
      <div className="consultList">
      {appointments.map(appointment => (
        <div className="eachConsult" key={appointment.id}>
        <img className="therapistImg" src={appointment.therapist_image} alt="therapist-img"/>
            <p>Dr. {appointment.therapist_first_name}</p>
            <p>{appointment.therapist_last_name}</p>
            <p>Appointment Date: {appointment.date}</p>
            <p>Appointment Time: {appointment.time}</p>
        </div>
      )
      )}

      </div>
    </div>
  )
}
export default withRouter(AppointmentList);
